import enum


def findTheDifference1(s, t):
    seen = {}
    for ch in s:
        if seen.get(ch)==None:
            seen[ch] = 1
        else:
            seen[ch] += 1
        
    for ch in t:
        if seen.get(ch)==None:
            return ch
        elif seen[ch] == 0:
            return ch
        else:
            seen[ch] -= 1

def findTheDifference2(s, t):
    s = sorted(list(s))
    t = sorted(list(t))

    ans = t[-1]
    for i in range(len(s)):
        if s[i] != t[i]:
            ans = t[i]
            break

    return ans


if __name__=='__main__':
    testcase = [
        ["abcd", "abcde"],
        ["", ""]
    ]
    for s, t in testcase:
        print(findTheDifference1(s, t))
        print(findTheDifference2(s, t))
        



    